  input: 'TEXT,F3A,,"In response to your letter of February 24, 2004 we submit the
    following: 1)  We have amended Schedule B of our report to clarify the descriptions
    regarding ''services'' and ''ballot''. 2)  Regarding the second issue raised in
    your letter regarding tickets, we believe that these expenditures constitute permissible
    expenditures of the campaign for the following reasons:  These were purchases
    for tickets to the Bayou Classic football game in November and the Sugar Bowl
    in January. The first football game is the premier African American sporting event
    in the United States and afforded the campaign an opportunity to place signs,
    stickers, buttons and other campaign items in a specific area where the seats
    were located.  Campaign workers and other people the campaign has worked closely
    with were given tickets to this event and greeted voters before, during and after
    the game.    Neither the Congressman nor any member of his family used any of
    these tickets. The second,a national championship game attended by supporters,
    donors and elected officials.  These gifts to constituent workers and supporters
    do not constitute personal use of campaign funds by the candidate as defined at
    11 CFR Section 113.1(g) for two reasons. They are part of a specific campaign
    or officeholder activity.   Second, the candidate did not use any of the tickets
    personally."'
